import React from 'react';
import HeaderSection from '../Header.js/header';
import TileCard from '../TileCard/TileCard';
import './Catalog.css'

const Catalog = () => {
    const tiles = [
        { id: 1, title: 'Tile 1 heading', description: 'Lorem ipsum dolor sit amet...', image: 'placeholder1.png' },
        { id: 2, title: 'Tile 2 heading', description: 'Lorem ipsum dolor sit amet...', image: 'placeholder2.png' },
        { id: 3, title: 'Tile 3 heading', description: 'Lorem ipsum dolor sit amet...', image: 'placeholder3.png' },
    ];

    return (
        <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
            <HeaderSection />
            <div style={{ display: 'flex', justifyContent: 'space-around', marginTop: '20px' }}>
                {tiles.map(tile => (
                    <TileCard key={tile.id} title={tile.title} description={tile.description} image={tile.image} />
                ))}
            </div>
        </div>
    );
};

export default Catalog;
